#include <stdio.h>
#include <stdlib.h>

int minCoins(int n, int m, int* denominations) {
    int* dp = (int*)malloc((n + 1) * sizeof(int));
    for (int i = 0; i <= n; i++) {
        dp[i] = n + 1;
    }
    dp[0] = 0;

    for (int i = 1; i <= n; i++) {
        for (int j = 0; j < m; j++) {
            if (denominations[j] <= i) {
                dp[i] = (dp[i] < dp[i - denominations[j]] + 1) ? dp[i] : dp[i - denominations[j]] + 1;
            }
        }
    }

    free(dp);
    return dp[n] == n + 1 ? -1 : dp[n];
}

int main() {
    int n, m;
    scanf("%d %d", &n, &m);
    int* denominations = (int*)malloc(m * sizeof(int));
    for (int i = 0; i < m; i++) {
        scanf("%d", &denominations[i]);
    }

    int result = minCoins(n, m, denominations);
    if (result != -1) {
        printf("%d\n", result);
    } else {
        printf("Not possible to make change\n");
    }

    free(denominations);
    return 0;
}
